import React from 'react';
import '../../App.css';
import Top from "../sections/top";

export default class Dashboard extends React.Component {
  render(){
    return(
    <div className="App">

        <div >
            <div className="covidalerta">
                
            </div>

            <div className="wave-containerkoi">
            
                <div className="logokoi">
                <h1 className="textokoi">Koinonia 2021 esta cerca, reserva o cancela tu boleto</h1>
                <h3 className="textokoi2">El evento que todos estan esperando y adaptandonos a lo digital.</h3>
                <h3 className="textokoi2">Ministerio Evangelico El Aposento alto. Koinonia 2021</h3>
                </div>
                
            </div>
        </div>

      
    </div>
  );
} }
